import React, {memo} from 'react';
import styled from 'styled-components';

const MenuContainer = styled.div`
    width:100%;
    height:470px;
    /* overflow: hidden; */

    .menuWrap{
        width:100%;
        height:100%;

        

        .menuInner{
            display: block;
            width:100%;
            height:100%;

            

            img{
                object-fit: cover;
                width:100%;
                height: auto;
            }
        }
    }
`;

const Menu = memo(() => {
  return (
    <MenuContainer>
      <section className='menuWrap'>
        <a href='#' className='menuInner'>
            <img src='/img/menu_sec1.jpg' alt='CoffeeMenuBanner' />
            <div className='textWrap'></div>
        </a>
        <a href='#' className='moreBtn'>
            <img src='/img/icon/view_icon.png' alt='seeMore Button' />
        </a>
      </section>
    </MenuContainer>
  );
});

export default Menu;
